INSERT INTO `v1_d7efa07750f2610e6a08e20422e0eb5a0076a936e8f1d791d9f900ac158ca7a8` VALUES ("2023/09/22 14:59:59", 1, 126401, "2023/06/30 12:00:00", -470.0, 10001, 2, "クローチェ", "いらっしゃいませっ♪\nキャラバンコインを使って\n買い物ができますよっ！", 1.47, 0.0, 1, 2002, 1);
INSERT INTO `v1_d7efa07750f2610e6a08e20422e0eb5a0076a936e8f1d791d9f900ac158ca7a8` VALUES ("2023/09/22 14:59:59", 2, 126401, "2023/06/30 12:00:00", -470.0, 10002, 1, "クローチェ", "素敵な品が揃ってるので\nたーっくさん買っていって\nくださいねっ♪", 2.15, 0.0, 1, 2002, 2);
INSERT INTO `v1_d7efa07750f2610e6a08e20422e0eb5a0076a936e8f1d791d9f900ac158ca7a8` VALUES ("2023/09/22 14:59:59", 1, 126501, "2023/06/30 12:00:00", -470.0, 10003, 2, "ライラエル", "ショップへようこそ\nキャラバンコインはこちら\nで買い物に使えますよ", 0.0, 0.0, 1, 2002, 2);
INSERT INTO `v1_d7efa07750f2610e6a08e20422e0eb5a0076a936e8f1d791d9f900ac158ca7a8` VALUES ("2023/09/22 14:59:59", 2, 126501, "2023/06/30 12:00:00", -470.0, 10004, 1, "ライラエル", "こちらのショップで\n買い物をして、素敵な\n旅を楽しんでくださいね", 0.0, 0.0, 1, 2002, 1);
INSERT INTO `v1_d7efa07750f2610e6a08e20422e0eb5a0076a936e8f1d791d9f900ac158ca7a8` VALUES ("2023/12/22 14:59:59", 1, 127702, "2023/09/15 15:00:00", -470.0, 10005, 2, "リンド", "いらっしゃいませ\nキャラバンコインを使って\nお買い物ができますよ", 0.0, 0.0, 2, 2002, 2);
INSERT INTO `v1_d7efa07750f2610e6a08e20422e0eb5a0076a936e8f1d791d9f900ac158ca7a8` VALUES ("2023/12/22 14:59:59", 2, 127702, "2023/09/15 15:00:00", -470.0, 10006, 2, "リンド", "ショップの掃除は完璧です\n姫さま直営のお店として\n当然のことですから", 0.0, 0.0, 2, 2002, 2);
INSERT INTO `v1_d7efa07750f2610e6a08e20422e0eb5a0076a936e8f1d791d9f900ac158ca7a8` VALUES ("2023/12/22 14:59:59", 1, 127802, "2023/09/15 15:00:00", -470.0, 10007, 1, "ヴルム", "ショップへようこそ\nキャラバンコインと品物を\n交換できるんで、よければ", 0.0, 0.0, 2, 2002, 1);
INSERT INTO `v1_d7efa07750f2610e6a08e20422e0eb5a0076a936e8f1d791d9f900ac158ca7a8` VALUES ("2023/12/22 14:59:59", 2, 127802, "2023/09/15 15:00:00", -470.0, 10008, 1, "ヴルム", "なんで店番なんか…\nま、やりますけど\n好きな品物をどうぞ", 6.5, 0.0, 2, 2002, 2);
INSERT INTO `v1_d7efa07750f2610e6a08e20422e0eb5a0076a936e8f1d791d9f900ac158ca7a8` VALUES ("2024/03/22 14:59:59", 1, 129602, "2023/12/15 15:00:00", -470.0, 10009, 1, "アネモネ", "──いらっしゃいませ\n買い物しても、いいですよ\nキャラバンコインがあれば", 0.0, 0.0, 3, 2002, 2);
INSERT INTO `v1_d7efa07750f2610e6a08e20422e0eb5a0076a936e8f1d791d9f900ac158ca7a8` VALUES ("2024/03/22 14:59:59", 2, 129602, "2023/12/15 15:00:00", -470.0, 10010, 1, "アネモネ", "──もっと笑顔がほしい？\nいくらコインを積まれても\n売れない物はありますから", 0.0, 0.0, 3, 2002, 2);
INSERT INTO `v1_d7efa07750f2610e6a08e20422e0eb5a0076a936e8f1d791d9f900ac158ca7a8` VALUES ("2024/03/22 14:59:59", 1, 129701, "2023/12/15 15:00:00", -470.0, 10011, 1, "ネフィ=ネラ", "ようこそおいでなんし\nキャラバンコインをこちら\nで交換して進ぜんしょう", 0.0, 0.0, 3, 2002, 1);
INSERT INTO `v1_d7efa07750f2610e6a08e20422e0eb5a0076a936e8f1d791d9f900ac158ca7a8` VALUES ("2024/03/22 14:59:59", 2, 129701, "2023/12/15 15:00:00", -470.0, 10012, 1, "ネフィ=ネラ", "ところで、お前さまは\nいくらで贖えるのか喃？\n──フフ、冗談でありんす", 6.2, 0.0, 3, 2002, 2);
INSERT INTO `v1_d7efa07750f2610e6a08e20422e0eb5a0076a936e8f1d791d9f900ac158ca7a8` VALUES ("2024/06/22 14:59:59", 1, 130301, "2024/03/15 15:00:00", -470.0, 10013, 5, "カノン", "い、いらっしゃいませっ！\n…くっ…このあたくし様が\n店番なんて…屈辱ですわっ", 3.1, 0.0, 4, 2002, 3);
INSERT INTO `v1_d7efa07750f2610e6a08e20422e0eb5a0076a936e8f1d791d9f900ac158ca7a8` VALUES ("2024/06/22 14:59:59", 2, 130301, "2024/03/15 15:00:00", -470.0, 10014, 2, "カノン", "あら、あたくしをご所望？\nお生憎様、そんな小銭では\n…買えちゃうんですの！？", 6.15, 0.0, 4, 2002, 3);
INSERT INTO `v1_d7efa07750f2610e6a08e20422e0eb5a0076a936e8f1d791d9f900ac158ca7a8` VALUES ("2024/06/22 14:59:59", 1, 130401, "2024/03/15 15:00:00", -470.0, 10015, 2, "ナーナ", "いらっしゃいませ～♪\nきゃらばんこいん？を\n交換できるんだってー", 0.0, 0.0, 4, 2002, 2);
INSERT INTO `v1_d7efa07750f2610e6a08e20422e0eb5a0076a936e8f1d791d9f900ac158ca7a8` VALUES ("2024/06/22 14:59:59", 2, 130401, "2024/03/15 15:00:00", -470.0, 10016, 1, "ナーナ", "甘いのくれたら、\nお礼にナーナの拾った\n松ぼっくりあげちゃうよ！", 3.35, 0.0, 4, 2002, 2);
INSERT INTO `v1_d7efa07750f2610e6a08e20422e0eb5a0076a936e8f1d791d9f900ac158ca7a8` VALUES ("2024/09/22 14:59:59", 1, 130502, "2024/06/15 15:00:00", -470.0, 10017, 1, "ホウオウ", "ショップへようこそ\nこの鳳凰が、皆さんに\n祝福を差し上げましょう", 0.0, 0.0, 5, 2002, 1);
INSERT INTO `v1_d7efa07750f2610e6a08e20422e0eb5a0076a936e8f1d791d9f900ac158ca7a8` VALUES ("2024/09/22 14:59:59", 2, 130502, "2024/06/15 15:00:00", -470.0, 10018, 1, "ホウオウ", "ほーちゃんと呼ぶ権利は\n売っていませんよ？\n騎士さんへの、特別です！", 3.18, 0.0, 5, 2002, 2);
INSERT INTO `v1_d7efa07750f2610e6a08e20422e0eb5a0076a936e8f1d791d9f900ac158ca7a8` VALUES ("2024/09/22 14:59:59", 3, 130503, "2024/06/15 15:00:00", -470.0, 10019, 4, "ホウオウ", "うﾞぇぇえんっ！まﾞだごの\n格好になっぢゃいまじだ！\n寄付をお願いじまず～っ！", 0.0, 0.0, 5, 2002, 4);
INSERT INTO `v1_d7efa07750f2610e6a08e20422e0eb5a0076a936e8f1d791d9f900ac158ca7a8` VALUES ("2024/09/22 14:59:59", 1, 123301, "2024/06/15 15:00:00", -470.0, 10020, 2, "ネア", "おっすー♪\nなんでも交換してけー\nカリザきゅん以外で", 4.9, 0.0, 5, 2002, 1);
INSERT INTO `v1_d7efa07750f2610e6a08e20422e0eb5a0076a936e8f1d791d9f900ac158ca7a8` VALUES ("2024/09/22 14:59:59", 2, 123301, "2024/06/15 15:00:00", -470.0, 10021, 2, "ネア", "ところで、騎士きゅんは\nおいくら万ルピ？\nジョーダンぬ・き・で♡", 4.8, 0.0, 5, 2002, 1);
INSERT INTO `v1_d7efa07750f2610e6a08e20422e0eb5a0076a936e8f1d791d9f900ac158ca7a8` VALUES ("2024/12/22 14:59:59", 1, 133301, "2024/09/15 15:00:00", -470.0, 10022, 1, "カリザ", "ケッ、なんでオレ様が店番\nなんざ…って来んなキイロ\nオレは売りモンじゃねー！", 4.922, 0.0, 6, 2002, 3);
INSERT INTO `v1_d7efa07750f2610e6a08e20422e0eb5a0076a936e8f1d791d9f900ac158ca7a8` VALUES ("2024/12/22 14:59:59", 2, 133301, "2024/09/15 15:00:00", -470.0, 10023, 5, "カリザ", "い、言わなきゃダメか？\n「…いらっしゃいませ…」\nクソッ、笑うんじゃねー！", 9.638, 0.0, 6, 2002, 3);
INSERT INTO `v1_d7efa07750f2610e6a08e20422e0eb5a0076a936e8f1d791d9f900ac158ca7a8` VALUES ("2024/12/22 14:59:59", 1, 133401, "2024/09/15 15:00:00", -470.0, 10024, 2, "ミーア", "ショップへようこそ～\nネラさまの腹心…的な私が\n店番させていただきま～す", 2.88, 0.0, 6, 2002, 1);
INSERT INTO `v1_d7efa07750f2610e6a08e20422e0eb5a0076a936e8f1d791d9f900ac158ca7a8` VALUES ("2024/12/22 14:59:59", 2, 133401, "2024/09/15 15:00:00", -470.0, 10025, 1, "ミーア", "私の抜け殻とか、\n需要ありますかね～…\nって冗談ですよ、冗談！", 4.818, 0.0, 6, 2002, 5);
INSERT INTO `v1_d7efa07750f2610e6a08e20422e0eb5a0076a936e8f1d791d9f900ac158ca7a8` VALUES ("2025/03/22 14:59:59", 1, 133002, "2024/12/15 15:00:00", -470.0, 10026, 1, "グレイス", "へい、らっしゃい\nさ、騎士氏。冥土の土産は\nなにがいいですか？", 1.78, 0.0, 7, 2002, 2);
INSERT INTO `v1_d7efa07750f2610e6a08e20422e0eb5a0076a936e8f1d791d9f900ac158ca7a8` VALUES ("2025/03/22 14:59:59", 2, 133002, "2024/12/15 15:00:00", -470.0, 10027, 7, "グレイス", "商品をお買い上げ毎に\nグレイスちゃんポイントを\n差し上げます。嘘ですが", 6.15, 0.0, 7, 2002, 1);
INSERT INTO `v1_d7efa07750f2610e6a08e20422e0eb5a0076a936e8f1d791d9f900ac158ca7a8` VALUES ("2025/03/22 14:59:59", 1, 133102, "2024/12/15 15:00:00", -470.0, 10028, 2, "ヴァイオレット", "ようこそいらっしゃいませ\n…接客とは、このような\n振舞で宜しいでしょうか？", 4.28, 0.0, 7, 2002, 6);
INSERT INTO `v1_d7efa07750f2610e6a08e20422e0eb5a0076a936e8f1d791d9f900ac158ca7a8` VALUES ("2025/03/22 14:59:59", 2, 133102, "2024/12/15 15:00:00", -470.0, 10029, 1, "ヴァイオレット", "じめじめした商品は\nございませんので\n安心してお買い求め下さい", 0.0, 0.0, 7, 2002, 1);
INSERT INTO `v1_d7efa07750f2610e6a08e20422e0eb5a0076a936e8f1d791d9f900ac158ca7a8` VALUES ("2025/06/23 14:59:59", 1, 136902, "2025/03/15 15:00:00", -470.0, 10030, 1, "ルルィ", "いらっしゃいましぇでしゅ\n何をお求めでしゅか？\nたこ焼きもありましゅよ！", 5.53, 0.0, 8, 2002, 2);
INSERT INTO `v1_d7efa07750f2610e6a08e20422e0eb5a0076a936e8f1d791d9f900ac158ca7a8` VALUES ("2025/06/23 14:59:59", 2, 136902, "2025/03/15 15:00:00", -470.0, 10031, 7, "ルルィ", "そのコイン…ピカピカで、\n集めたくなっちゃいましゅ\nタコ釣られされちゃう～…", 6.05, 0.0, 8, 2002, 9);
INSERT INTO `v1_d7efa07750f2610e6a08e20422e0eb5a0076a936e8f1d791d9f900ac158ca7a8` VALUES ("2025/06/23 14:59:59", 1, 137001, "2025/03/15 15:00:00", -470.0, 10032, 1, "デュラン", "姫のご友人ならば\n礼儀を尽くすのが爺の務め\nさ、望みの物を言いたまえ", 0.0, 0.0, 8, 2002, 2);
INSERT INTO `v1_d7efa07750f2610e6a08e20422e0eb5a0076a936e8f1d791d9f900ac158ca7a8` VALUES ("2025/06/23 14:59:59", 2, 137001, "2025/03/15 15:00:00", -470.0, 10033, 1, "デュラン", "キャラバンコインではなく\n首で支払って貰えんかのぅ\n…冗談であるぞ？", 0.0, 0.0, 8, 2002, 2);
INSERT INTO `v1_d7efa07750f2610e6a08e20422e0eb5a0076a936e8f1d791d9f900ac158ca7a8` VALUES ("2025/09/22 14:59:59", 1, 135902, "2025/06/16 15:00:00", -470.0, 10034, 2, "サツキ", "おう\n好きなもん持ってきな", 0.0, 0.0, 9, 2002, 2);
INSERT INTO `v1_d7efa07750f2610e6a08e20422e0eb5a0076a936e8f1d791d9f900ac158ca7a8` VALUES ("2025/09/22 14:59:59", 2, 135902, "2025/06/16 15:00:00", -470.0, 10035, 6, "サツキ", "宵越しの銭を持つような\n野暮いマネぁしくさんな\nツキが落ちてもしらねぇぜ", 4.935, 0.0, 9, 2002, 1);
INSERT INTO `v1_d7efa07750f2610e6a08e20422e0eb5a0076a936e8f1d791d9f900ac158ca7a8` VALUES ("2025/09/22 14:59:59", 1, 135802, "2025/06/16 15:00:00", -470.0, 10036, 5, "ユキノ", "ら、ら、らっしゃっせ…\nなんかほしいもん、ある？\nか、かき氷とか、ど…？", 7.441, 0.0, 9, 2002, 2);
INSERT INTO `v1_d7efa07750f2610e6a08e20422e0eb5a0076a936e8f1d791d9f900ac158ca7a8` VALUES ("2025/09/22 14:59:59", 2, 135802, "2025/06/16 15:00:00", -470.0, 10037, 7, "ユキノ", "そ、そんな見ねぇで…\nあては、売りもんじゃ\nねぇよ…？", 0.0, 0.0, 9, 2002, 7);
